import { Link } from 'react-router-dom';
import './Video.css';

const Video = (props) => {
    return (
        <div>
            <Link to={{ pathname:`/${props.trailerId}`}} >
            <button className="button2" alt="button"> Trailer</button>
            </Link>
        </div>
    )
}

